import React from 'react';
import { render } from 'react-dom';
import MultiRangeSlider from '../../components/MultiRangeSlider/MultiRangeSlider';

const Split = () => {
  const min = 0; // 최소값
  const max = 1000; // 최대값

  return (
    <div>
      <div
        style={{
          width: '80vw',
          height: '80vh',
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <MultiRangeSlider min={min} max={max} />
    </div>
  );
};

export default Split;
